INSERT INTO NominaG4CFG (Modulo, NombreCSV, Qry, Params, Estatus) VALUES ( 'Nomina', '70.Nomina.Tabla.ISR.csv', 'SELECT PeriodoTipo AS ''TipoPeriodo'', ROW_NUMBER() OVER(ORDER BY LimiteInferior) AS Renglon,  LimiteInferior, LimiteSuperior, Cuota AS [Cuota Fija], Porcentaje as [% S/Excedente] FROM TablaImpuestoD WHERE TablaImpuesto = ''ISR'' AND PeriodoTipo = ''Semanal'' UNION ALL SELECT PeriodoTipo AS ''TipoPeriodo'', ROW_NUMBER() OVER(ORDER BY LimiteInferior) AS Renglon,  LimiteInferior, LimiteSuperior, Cuota AS [Cuota Fija], Porcentaje as [% S/Excedente] FROM TablaImpuestoD WHERE TablaImpuesto = ''ISR'' AND PeriodoTipo = ''Catorcenal'' UNION ALL SELECT PeriodoTipo AS ''TipoPeriodo'', ROW_NUMBER() OVER(ORDER BY LimiteInferior) AS Renglon,  LimiteInferior, LimiteSuperior, Cuota AS [Cuota Fija], Porcentaje as [% S/Excedente] FROM TablaImpuestoD WHERE TablaImpuesto = ''ISR'' AND PeriodoTipo = ''Mensual'' UNION ALL SELECT PeriodoTipo AS ''TipoPeriodo'', ROW_NUMBER() OVER(ORDER BY LimiteInferior) AS Renglon,  LimiteInferior, LimiteSuperior, Cuota AS [Cuota Fija], Porcentaje as [% S/Excedente] FROM TablaImpuestoD WHERE TablaImpuesto = ''ISR'' AND PeriodoTipo = ''Anual'' UNION ALL SELECT PeriodoTipo AS ''TipoPeriodo'', ROW_NUMBER() OVER(ORDER BY LimiteInferior) AS Renglon,  LimiteInferior, LimiteSuperior, Cuota AS [Cuota Fija], Porcentaje as [% S/Excedente] FROM TablaImpuestoD WHERE TablaImpuesto = ''ISR'' AND PeriodoTipo = ''Quincenal'' ', ' ', '1') 
INSERT INTO NominaG4CFG (Modulo, NombreCSV, Qry, Params, Estatus) VALUES ( 'Nomina', '80.Nomina.Tabla.SAE.csv', 'SELECT PeriodoTipo AS ''TipoPeriodo'', ROW_NUMBER() OVER(ORDER BY LimiteInferior) AS Renglon,  LimiteInferior, LimiteSuperior, Cuota AS [Cuota Fija], Porcentaje as [% S/Excedente] FROM TablaImpuestoD WHERE TablaImpuesto = ''SAE'' AND PeriodoTipo = ''Semanal'' UNION ALL SELECT PeriodoTipo AS ''TipoPeriodo'', ROW_NUMBER() OVER(ORDER BY LimiteInferior) AS Renglon,  LimiteInferior, LimiteSuperior, Cuota AS [Cuota Fija], Porcentaje as [% S/Excedente] FROM TablaImpuestoD WHERE TablaImpuesto = ''SAE'' AND PeriodoTipo = ''Catorcenal'' UNION ALL SELECT PeriodoTipo AS ''TipoPeriodo'', ROW_NUMBER() OVER(ORDER BY LimiteInferior) AS Renglon,  LimiteInferior, LimiteSuperior, Cuota AS [Cuota Fija], Porcentaje as [% S/Excedente] FROM TablaImpuestoD WHERE TablaImpuesto = ''SAE'' AND PeriodoTipo = ''Mensual'' UNION ALL SELECT PeriodoTipo AS ''TipoPeriodo'', ROW_NUMBER() OVER(ORDER BY LimiteInferior) AS Renglon,  LimiteInferior, LimiteSuperior, Cuota AS [Cuota Fija], Porcentaje as [% S/Excedente] FROM TablaImpuestoD WHERE TablaImpuesto = ''SAE'' AND PeriodoTipo = ''Anual'' UNION ALL SELECT PeriodoTipo AS ''TipoPeriodo'', ROW_NUMBER() OVER(ORDER BY LimiteInferior) AS Renglon,  LimiteInferior, LimiteSuperior, Cuota AS [Cuota Fija], Porcentaje as [% S/Excedente] FROM TablaImpuestoD WHERE TablaImpuesto = ''SAE'' AND PeriodoTipo = ''Quincenal'' ', ' ', '1') 
