CREATE PROCEDURE spNominaG4CargaDatos
  @Empresa varchar(5)
--//WITH ENCRYPTION
AS
BEGIN
  DECLARE 
    @Hoy        DATETIME,
    @Dia        INT,
    @DiaInicio  VARCHAR(2),
    @Mes        INT,
    @Anio       INT

  SELECT @Hoy = GETDATE()
  SELECT @Dia = DAY(@Hoy), @Mes = MONTH(@Hoy), @Anio = YEAR(@Hoy)
  IF @Dia BETWEEN 1 AND 15
    SELECT @DiaInicio = '01'
  ELSE
    SELECT @DiaInicio = '16'

